import React from "react";
import { ListChecks, BookOpen, Target, Activity } from "lucide-react";

export default function PersonalCard() {
  return (
    <div className="bg-[#fafafa] shadow-md rounded-xl p-6 flex justify-between items-center">
      <div>
        <h2 className="uppercase tracking-widest text-xs mb-3 text-gray-500">â€” Personal</h2>
        <ul className="space-y-2 text-gray-700 text-sm">
          <li className="flex items-center gap-2"><ListChecks size={16}/> To-Do List</li>
          <li className="flex items-center gap-2"><BookOpen size={16}/> Journal</li>
          <li className="flex items-center gap-2"><Target size={16}/> Goals</li>
          <li className="flex items-center gap-2"><Activity size={16}/> Habits</li>
        </ul>
      </div>
      <div className="bg-[#f5dbea] rounded-full w-20 h-20 flex items-center justify-center text-xs font-serif text-gray-600">
        PERSONAL
      </div>
    </div>
  );
}
